import React from 'react'
import ReactEcharts from 'echarts-for-react'

class BarChartTopics extends React.Component {

    getOption = () => ({
        xAxis: {
            type: 'category',
            data: ['Estigmatizante', 'Literal']
          },
          yAxis: {
            type: 'value'
          },
          series: [
            {
              data: [120, 200],
              type: 'bar',
              showBackground: true,
              backgroundStyle: {
                color: 'rgba(180, 180, 180, 0.2)'
              }
            }
          ],
          tooltip: {
            trigger: 'item'
          },
          legend: {
            top: '5%',
            left: 'center',
            textStyle: {
              fontSize: 16,
              fontFamily: 'Verdana, Geneva, Tahoma, sans-serif',
            },
          },
      });

      render(){
        return (
            <ReactEcharts
                option={this.getOption()}
                style={{ height: "400px", width: "400px", marginLeft:"80px", marginTop:"30px"}}
            />
        );
      }




}

export default BarChartTopics
